  false,\n\t\"url\": null,\n\t\"notes\": \"This geodatabase consists of a point feature
  class and related tables representing sample sites where vegetation data were collected
  from 2007 to 2013 in Clark and Lincoln Counties, Nevada. Samples are identified
  with a vegetation stand name and classified from the alliance to the class level
  of the National Vegetation Classification Standard (NVC; Federal Geographic Data
  Committee, 2008). The database is also available in tabular format as tab-delimited
  text files or a Microsoft Excel spreadsheet. Reference Cited: Federal Geographic
  Data Committee, 2008, National Vegetation Classification Standard, Version 2, FGDC-STD-005-2008,
  accessed December 6, 2012, http://www.fgdc.gov/standards/projects/FGDC-standards-projects/vegetation/NVCS_V2_FINAL_2008.pdf.\",\n\t\"license_title\":
